import React,{useEffect}from "react";
import { useNavigate,useLocation} from "react-router-dom";

export default function Welcome() {
    const navigate = useNavigate();
    const a=()=>{
      if(!localStorage.getItem('token')){
        navigate('/welcome');
      }
    }
    a();
  return (
    <>
    <div>Welcome</div>
    </>
  )
}
